import dataM from '../data/gogungCategory.json';
import search_black_24dp from '../img/search_black_24dp.svg';

import {Fragment} from 'react';

function Search(){
    // 랜덤 숫자
    let img = Math.floor(Math.random()*5);
    return(
        <>
            <div className="search">
                <img src={dataM.gogung[img].imgUrl} alt=""/>
                <Fragment>
                    <span><img src={search_black_24dp} alt=""/></span>
                    <Search placeholder="오늘은 고궁에 가볼까?" onSearch={(e)=>console.log(e)}/>
                </Fragment>
            </div>
        </>
    );
}
export default Search;
